const AppFilter = () => {
  return (
    <div className="btn-group">
      <button className="btn btn-light" type="button">
      All employees
      </button>
      <button className="btn btn-outline-light" type="button">
      Employees for promotion
      </button>
      <button className="btn btn-outline-light" type="button">
        З/п больше 1000 дол.
      </button>
    </div>
  );
};

export default AppFilter;
